      <div className='h-64'>
        <img
          className='w-full h-full bg-cover bg-no-repeat object-cover rounded'
          src={img}
        />
      </div>
      <div style={{ top: '50%', left: '50%' }} className='absolute top-0'>
        hello
      </div>
    </div>
  );
};
